import React, { Component } from 'react';

class Experience extends Component {
    render() {
        return (
            <div>
                <div className = "card">
                    <div className = "card-content">
                    <h5><b>KINH NGHIỆM</b></h5>
                        <div className = "row">
                            <div className = "col s12 m4 l4 xl4">
                                <b>Tháng 9/2019 - Tháng 9/2020: Thực tập và tham gia hoàn thành 1 dự án website tại công ty VietMMO</b>
                            </div>  
                            <div className = "col s12 m8 l8 x18">
                                <blockquote className = "no-pad">
                                    <h6 className = "no-pad mt-bottom">
                                        <b>Lập trình web</b>
                                    </h6>
                                    <p>Thực tập và tham gia hoàn thành 1 dự án website tại công ty VietMMO</p>
                                </blockquote>
                            </div>
                        </div>
                        <div className = "row">
                        </div>
                    </div>
                </div>
            </div>
        );
    }
}

export default Experience;
